import React from 'react'
import logo from '../src/images/Vector-Smart-Object11.png'
import './header.css'
import {Link} from 'react-router-dom'




function header() {
 
function home(){
  document.getElementById("homid").style.webkitTextFillColor="white"
  document.getElementById("abt").style.webkitTextFillColor=""
  document.getElementById("ser").style.webkitTextFillColor=""
  document.getElementById("cont").style.webkitTextFillColor=""
}  
function about(){
  document.getElementById("homid").style.webkitTextFillColor=""
  document.getElementById("abt").style.webkitTextFillColor="white"
  document.getElementById("ser").style.webkitTextFillColor=""
  document.getElementById("cont").style.webkitTextFillColor=""
}
function services(){
  document.getElementById("homid").style.webkitTextFillColor=""
  document.getElementById("abt").style.webkitTextFillColor=""
  document.getElementById("ser").style.webkitTextFillColor="white"
  document.getElementById("cont").style.webkitTextFillColor=""
}
function contact(){
  document.getElementById("homid").style.webkitTextFillColor=""
  document.getElementById("abt").style.webkitTextFillColor=""
  document.getElementById("ser").style.webkitTextFillColor=""
  document.getElementById("cont").style.webkitTextFillColor="white"
}

  return (
    <div className='navbar'>

     <div className='logo'>
     <img src={logo} className='image-logo' alt=''></img>
     </div>
     <div className='nav-text'>
      
        <Link className='link-header' to ='/'>        <p onClick={home} id='homid' className='navtexts'>HOME</p></Link>
        <Link  className='link-header'  to='/aboutus'> <p onClick={about}   id='abt'  className='navtexts'>ABOUT</p></Link>
        <Link  className='link-header' to ='/services'><p onClick={services}  id="ser"  className='navtexts'>SERVICES</p></Link>
        <Link  className='link-header' to='/contactus'><p onClick={contact} id='cont' className='navtexts'>CONTACT US</p></Link>
        
        
        </div>
  
       
       </div>
  
   
  

  )
}

export default header
